import styled, { css } from "styled-components";

export const FooterSectionContainer = styled.div`
  width: 100%;
  align-items: center;
  background: #161616;
  padding: 0 8px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export const FooterSectionWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 32px 0px;
  max-width: 1110px;
`;
